const output = $input.first().json.output;
return [{
  json: {
    chosenIdea: output.chosenIdea,
    emailBody: output.emailBody,
    name: $('Automation Ideas Library').first().json.name,
    email: $('Automation Ideas Library').first().json.email,
    company: $('Automation Ideas Library').first().json.company
  }
}];

// Placeholder logic: Check if reply was received
// In production, this would query Microsoft Outlook API
// to check if the sent email received a reply

const items = $input.all();

return items.map(item => {
  return {
    json: {
      ...item.json,
      replyReceived: false // Placeholder - set to false for now
    }
  };
});
